import React from 'react';
import './NossaFrota.css'; // Crie um arquivo CSS se necessário

function NossaFrota() {
    return (
        <div className="nossa-frota-page">
            <h1>Nossa Frota</h1>
            <p>Conteúdo provisório para a página da frota.</p>
        </div>
    );
}

export default NossaFrota;
